import React, { useEffect, useState } from 'react';
import ReactDOM from 'react-dom';




const App = () => {
    const [users, setUsers] = useState([]);
    const [posts, setPosts] = useState([]);
    const [isLoggedIn, setIsLoggedIn] = useState(false);
    const [currentUser, setCurrentUser] = useState({})

    useEffect(() => {
        const fetchPosts = async () => {
            try {
                const response = await fetch('https://strangers-things.herokuapp.com/api/2206-FTB-ET-WEB-FT-B/posts');
                console.log('The response: ', response);
                const result = await response.json();
                console.log('The actual data: ', result);
                setPosts(result.post);
            } catch (error) {
                console.error(error);
            }
        };
        fetchPosts();
    }, [])

    return (
        <div className="app">
            <div>
                <p>hi</p>
            </div>

            {
                posts.length ? posts.map((individualPosts, index) => {
                    return <div>
                        <p>Username: {individualPosts.data.posts}</p>
                    </div>
                }) : <div>No posts to display</div>
            }
        </div>
    )
}

const appElement = document.getElementById('app');

ReactDOM.render(<App />, appElement);
